import Home from "./Mycomponents/Home";
import Navbar from "./Mycomponents/Navbar";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <div className="content">
          <Switch>
            <Router path="/">
              <Home />
            </Router>
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
